    constructor(props){
        super(props);
    }
    render(){
        return(
            <div>
                <Student_box
                name= "Raul"
                answers = {answers}
                correct_answer ={correct_answer}
                />
                <Student_box
                name= "Angie"
                answers = {answers}
                correct_answer ={correct_answer}
                />
            </div>
    
        )
    }
}
